-- Table structure for table `recommend_fragrances`
--

DROP TABLE IF EXISTS `recommend_fragrances`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `recommend_fragrances` (
  `nick` varchar(15) NOT NULL,
  `brand` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  PRIMARY KEY (`nick`,`brand`,`name`),
  UNIQUE KEY `nick_UNIQUE` (`nick`),
  KEY `br_idx` (`brand`,`name`),
